import React from 'react';
import NavBar from './NavBar';
// import { render } from '../../api/app';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={apiResponse:""}
  }
  callAPI(){
    fetch("https://codeforces.com/api/contest.standings?contestId=566&from=1&count=5&showUnofficial=true")
    .then(res => res.text())
    .then(res => this.setState({apiResponse: res}));
  }
componentWillMount(){
  this.callAPI();
}
render(){
  return(
    <div>
      <NavBar></NavBar>
      <p>{this.state.apiResponse}</p>
    </div>
  );
}

}

export default App;
